import styles from './Navigation.module.css';
import Link from 'next/link';

const Navigation = () => {
  return (
    <nav className="navbar navbar-dark bg-dark">
      <ul>
        <li>
          <Link href="/">
            <a >Index</a>
          </Link>
        </li>
        <li>
          <Link href="/about">
            <a >About</a>
          </Link>
        </li>
        <li>
          <Link href="/services">
            <a >Services</a>
          </Link>
        </li>
      </ul>
    </nav>
  );
}

export default Navigation;
